import "./ThreeGrid.css";

export default function ThreeGrid() {
	return (
		<div className="grid-container">
			<div className="big-left-grid">
                <h3 className="subtitle">Juice Fruits</h3>
                <h2 className="title"></h2>
			</div>
			<div className="top-right-grid">
				<h3 className="subtitle">Organic Fruits</h3>
			</div>
			<div className="bottom-right-grid">
				<h3 className="subtitle">Ice Cream</h3>
			</div>
		</div>
	);
}
